import React from 'react';
import ProjectNav from "../components/ProjectNav"

import SectionTitle from "../components/SectionTitle";

import '../assets/css/Project3.css';


import { Carousel } from 'react-responsive-carousel';
import '../assets/css/Project3.css';
import "react-responsive-carousel/lib/styles/carousel.min.css"; 

import "react-responsive-carousel/lib/styles/carousel.min.css"; 

import line from "../assets/css/line.png";


const Project3 = () => (
    <>
    <ProjectNav></ProjectNav>

    <div id = "rectr"></div>

    <h1 id = "title-p">
        RETRO ARCADE
    </h1>



    <div id = "box">
            <div id = "year">
                <img id = "line1" src = {line} />
                <h3 class = "subtitle">Year</h3>
                <p class = "para"> Sept 2020 </p>
            </div>

            <div id = "tools">
                <img id = "line2" src = {line} />
                <h3 class = "subtitle">Tools</h3>
                <p class = "para"> Figma, Canva, Instagram, Google Forms </p>
            </div>
        </div>


        <section id = "Overview">
        <SectionTitle 
        number = "1"
        name = "OVERVIEW"
        />
    </section>


    </>



);


export default Project3;
